ry key.'=>'غلط ریکوری کلید۔','Recovery key expired.'=>'ریکوری کلید ختم ہو گئی۔','Could not update the email last sent time.'=>'گذشتہ بھیجے گئے وقت ای میل کو اپڈیٹ نہیں کیا جا سکا۔','The email could not be sent. Possible reason: your host may have disabled the %s function.'=>'ای میل نہیں بھیجی جا سکی۔ ممکنہ وجہ: ہو سکتا ہے کہ آپ کے ہوسٹ نے %s فنکشن غیر فعال کردیا ہو۔','A recovery link was already sent %1$s ago. Please wait another %2$s before requesting a new email.'=>'ریکوری لنک %1$s پہلے بھیجا جا چکا ہے۔ برائے مہربانی   دوسری ای میل کی درخواست کرنے سے پہلے  %2$s  انتظار کریں','Error Details'=>'خرابی کی تفصیلات','[%s] Your Site is Experiencing a Technical Issue'=>'[%s]  آپ کی سائٹ میں کوئی تکنیکی خرابی آ رہی ہے','Error not caused by a plugin or theme.'=>'خرابی کی وجہ پلگ ان یا تھیم نہیں ہے۔','Failed to store the error.'=>'ایرر کو محفوظ نہیں کیا جا سکا','Exit recovery mode link expired.'=>'ریکوری موڈ کو ختم کرنے کا لنک ایکسپائر ہو چکا ہے','Failed to exit recovery mode. Please try again later.'=>'ریکوری موڈ بند نہیں ہوا۔ برائے مہربانی دوبارہ کوشش کریں۔','[%s] Network Admin Email Change Request'=>'[%s] نیٹ ورک ایڈمن کی ای میل تبدیلی کی درخواست ','[%s] Network Admin Email Changed'=>'[%s] نیٹ ورک ایڈمن کی ای میل تبدیل ہو گئی ہے ','Error occurred on a non-protected endpoint.'=>'ایک غیر محفوظ اینڈ پواوؐنٹ پر مسئلہ آگیا ہے','Please contact your host for assistance with investigating this issue further.'=>'اس مسئلہ میں مزید مدد کے لیے اپنی ہوسٹ سے رابطہ کریں','In this case, WordPress caught an error with one of your plugins, %s.'=>'اس صورت میں ورڈپریس کو آپ کی پلگ ان میں ایک مسئلہ ملا ہے، %s۔','In this case, WordPress caught an error with your theme, %s.'=>'اس صورت میں ورڈپریس کو آپ کی تھیم میں ایک مسئلہ ملا ہے، %s۔','Howdy!

Since WordPress 5.2 there is a built-in feature that detects when a plugin or theme causes a fatal error on your site, and notifies you with this automated email.
###CAUSE###
First, visit your website (###SITEURL###) and check for any visible issues. Next, visit the page where the error was caught (###PAGEURL###) and check for any visible issues.

###SUPPORT###

If your site appears broken and you can\'t access your dashboard normally, WordPress now has a special "recovery mode". This lets you safely login to your dashboard and investigate further.

###LINK###

To keep your site safe, this link will expire in ###EXPIRES###. Don\'t worry about that, though: a new link will be emailed to you if the error occurs again after it expires.

When seeking help with this issue, you may be asked for some of the following information:
###DEBUG###

###DETAILS###'=>'کیسے ہو

ورڈپریس 5.2 ایک بلٹ ان فیچر ہے جو اس بات کا پتہ لگاتی ہے کہ پلگ ان یا تھیم آپ کی سائٹ پر بگ کا سبب بنتا ہے ، اور آپ کو خودکار ای میل کے ذریعہ آپ کو مطلع کرتا ہے۔
### وجہ ###
پہلے ، اپنی ویب سائٹ (### سائٹ سائٹ ###) ملاحظہ کریں اور کوئی واضح امور دیکھیں۔ اس کے بعد ، اس صفحے پر جائیں جہاں خرابی واقع ہوئی ہے (### پیجآراویل ###) اور کسی واضح مسئلے کی جانچ کریں۔

### سپورٹ ###

اگر آپ کی سائٹ نمودار ہوتی ہے اور آپ کو عام طور پر آپ کے ڈیش بورڈ تک رسائی حاصل نہیں ہوتی ہے تو ، ورڈپریس اب ایک خاص "ریکوری موڈ" ہے۔ یہ آپ کو اپنے ڈیش بورڈ میں محفوظ طور پر لاگ ان کرنے اور مزید تحقیق کی اجازت دیتا ہے۔

### لنک ###

آپ کی سائٹ کی حفاظت کے لیے، اس لنک کی میعاد ### ختم ہوجائے گی ### اس کے بارے میں فکر مت کریں ، اگرچہ: غلطی کے بعد غلطی ٹھیک ہونے پر ایک نیا لنک آپ کو ای میل کیا جائے گا۔

جب اس مسئلے میں مدد طلب کرتے ہو تو ، آپ کو نیچے دی گئی کچھ معلومات کے لئے کہا جاتا ہے۔
