ht of %2$s pixels.'=>'اپنی ویڈیو%1$s فائل کی قسم میں اپ لوڈ کریں اور اچھے نتائج کے لیے اس کا سائز ممکنہ حد تک چھوٹا رکھیں۔ آپ کے تھیم کی سفارشات میں اس کی انچائی %2$s پکسل ہے۔','Header Video'=>'ہیڈر کے لیے ویڈیو','Background PresetPreset'=>'پہلےسے ترتیب شدہ','Default PresetDefault'=>'طے شدہ','Fit to Screen'=>'مکمل اسکرین پر پھیلایئں','Repeat ImageRepeat'=>'دہرائیں','Custom PresetCustom'=>'مرضی کے مطابق','Image Position'=>'تصویر کا مقام','Image Size'=>'تصویر کا ناپ','Repeat Background Image'=>'پس منظر تصویر کو دہرایئں','Scroll with Page'=>'صفحے کے ساتھ اسکرول کریں','Additional CSS'=>'اضافی سی ایس ایس','Learn more about CSS'=>'CSS کے متعلق مزید جانیے','Invalid value for background repeat.'=>'پسِ منظر کو دہرانے کے لیے غلط اندراج۔','Invalid value for background attachment.'=>'پسِ منظر سے منسلک کرنے کے لیے غلط اندراج۔','Invalid value for background position X.'=>'پسِ منظر کی افقی پوزیشن کے لیے غلط اندراج۔','Invalid value for background position Y.'=>'پسِ منظر کی عمودی پوزیشن کے لیے غلط اندراج۔','Invalid value for background size.'=>'پسِ منظر کے سائز کے لیے غلط اندراج۔','Unrecognized background setting.'=>'متفرق پس منظر کی ترتیب۔','This video file is too large to use as a header video. Try a shorter video or optimize the compression settings and re-upload a file that is less than 8MB. Or, upload your video to YouTube and link it with the option below.'=>'یہ ویڈیو ہیڈر ویڈیو میں استعمال کے لیے بہت بڑی ہے۔ اس ویڈیو کو چھوٹا کریں یا بہتر طریقہ سے سکیڑیں اور دوبارہ 8 ایم بی یا اس سے چھوٹے سائز میں اپلوڈ کریں۔ یا اپنی ویڈیو یوٹیوب پر اپ لوڈ کریں اور نیچلی ترتیب میں لنک کریں۔','Only %1$s or %2$s files may be used for header video. Please convert your video file and try again, or, upload your video to YouTube and link it with the option below.'=>'ہیڈر ویڈیو کے لیے آپ صرف %1$s یا %2$s قسم کی فائل استعمال کر سکتے ہین۔ براہِ کرم اپنی ویڈیو فائل کو کنورٹ کریں اور دوبارہ کوشش کریں، یا ہھر اہنی ویڈیو یوٹیوب پر اپلوڈ کریں اور اسکو نیچے دیے گئے آپشن کے ذریعے سے لنک کر دیں۔','Markup