ms the name of your database is prefixed with your username, so it would be like <code>username_%1$s</code>. Could that be the problem?'=>'کچھ سسٹمز پر آپک کا اسم رکنیت آپ کی ڈیٹا بیس کے نام کے شروع میں جوڑتے ہیں، جو کہ <code>username_%1$s</code> جیسا ہو سکتا ہے۔ کیا یہ مسئلے کی وجہ ہو سکتی ہے؟','If you don&#8217;t know how to set up a database you should <strong>contact your host</strong>. If all else fails you may find help at the <a href="%s">WordPress Support Forums</a>.'=>'اگرآپ کومعلوم نہیں کہ ڈیٹا بیس کیسے سیٹ اپ کرتے ہیں تو آپ اپنے <strong>ہوسٹ سے رابطہ </strong> کریں۔ اگر سب کوششیں ناکام ہو جائیں تو آپ <a href="%s">WordPress معاونتی فورمز</a> پرمدد تلاش کریں۔','This either means that the username and password information in your %1$s file is incorrect or we can&#8217;t contact the database server at %2$s. This could mean your host&#8217;s database server is down.'=>'اسکا مطلب ہے کہ یا تو آپ کی %1$s فائل میں اسم رکنیت اور پاسورڈ کی معلومات غلط ہیں، یا پھر ہم %2$s پر واقع ڈیٹابیس سرور سے رابطہ نہیں کر سکتے۔ یہ بھی ممکن ہے کہ آپ کا ڈیٹا بیس سرور ڈاؤن ہے۔','Are you sure you have the correct username and password?'=>'کیا آپ کو یقین ہے کہ آپ کے پاس درست اسم رکنیت اور پاسورڈ ہے؟','Are you sure you have typed the correct hostname?'=>'کیا آپ کو یقین ہے کہ درست ہوسٹ نیم ٹائپ کر چکے ہیں؟','Are you sure the database server is running?'=>'کیا آپ کو یقین ہےکہ ڈیٹا بیس سرور چل رہا ہے؟','If you&#8217;re unsure what these terms mean you should probably contact your host. If you still need help you can always visit the <a href="%s">WordPress Support Forums</a>.'=>'اگرآپ ان اصطلاحات کو سمجھنے سے متعلق غیریقینی کا شکار ہیں تو آپ کو اپنے ہوسٹ سے رابطہ کرنا چاہیے۔ اگر پھر بھی آپ کو مزید مدد درکار ہے تو <a href="%s">WordPress معاونتی فورمز</a> پر جائیں۔','Error reconnecting to the database'=>'ڈیٹا بیس سے منسلک کرنے میں خرابی ','This means that we lost contact with the database server at %s. This could mean your host&#8217;s database server is down.'=>'اس کا مطلب ہے کہ