ے گا، آپ اس سائٹ پر صارف کے ڈیٹا تک رسائی حاصل کرنے کی اجازت نہیں ہے۔','pluginInstalling %s...'=>'%s انسٹال ہو رہا ہے۔۔۔','themeInstalling %s...'=>'%s انسٹال ہو رہا ہے۔۔۔','plugin%s installed!'=>'%s انسٹال کر دیا گیا','theme%s installed!'=>'%s انسٹال کر دی گئی!','plugin%s installation failed'=>'%s کی انسٹالیشن میں ناکامی','theme%s installation failed'=>'%s کی انسٹالیشن میں ناکامی','pluginNetwork Activate %s'=>'نیٹ ورک فعال کریں %s','pluginActivate %s'=>'%s فعال کریں','themeNetwork Activate %s'=>'%s نیٹ فعال کریں','themeActivate %s'=>'%s کو فعال کریں ','Importer installed successfully. <a href="%s">Run importer</a>'=>'امپورٹر کامیابی سے انسٹال ہو گیا ہے <a href="%s">امپورٹر کو چلائیں</a>','Run Importer'=>'امپورٹر کو چلائیں','Run %s'=>'%s چلائیں ','Search Results'=>'تلاش کےنتائج','Theme starter contentFind Us'=>'ہمیں تلاش کریں','Sorry, the term could not be created.'=>'معاف کیجیے گا، آپکی ٹرم نہیں بنائی جا سکتی۔','Sorry, you are not allowed to edit this term.'=>'معاف کیجیے گا، آپ کو اس ٹرم میں تبدیلی کرنے کی اجازت نہیں ہے۔','Sorry, you are not allowed to delete this term.'=>'معاف کیجیے گا، آپ کو اس ٹرم کو حذف کرنے کی اجازت نہیں ہے۔','Sorry, you are not allowed to assign this term.'=>'معاف کیجیے گا، آپ کو اس ٹرم کو تفویض کرنے کی اجازت نہیں ہے۔','Invalid role.'=>'غلط کردار۔','Sorry, the comment could not be updated.'=>'معاف کیجیے گا، یہ تبصرہ تبدیل نہیں ہو سکتا۔','Whether to bypass Trash and force deletion.'=>'آیا کہ ردی کی ٹوکری کو بائی پاس کر کے حذف کرنے پر مجبور کیا جائے۔','Query parameter not permitted: %s'=>'استفسار پیرامیٹر کی اجازت نہیں: %s','Sorry, you must be logged in to comment.'=>'معاف کیجیے گا، تبصرہ کرنے کے لیے آپ کو لاگ ان کرنا پڑے گا۔','Cannot create existing comment.'=>'پہلے سے موجود تبصرہ دوبارہ نہیں کیا جا سکتا۔','Creating a comment requires valid author name and email values.'=>'تبصرہ کرنے کے لیے درست مصنف کے نام اورای میل کی ضرورت ہے۔','Creating comment failed.'=>'تبصرہ کرنےمیں ناکامی۔','Updating comment status failed.'=>'تبصرے کے درجے کو اپ ڈیٹ کرنے میں ناکامی۔','Updating comment failed.'=>'تبصرہ اپ ڈیٹ کرنے میں ناکامی۔','The comment has already been trashed.'=>'تبصرہ پہلے ہی ردی کی ٹوکری میں ڈال دیا گیا ہے۔','The comment cannot be deleted.'=>'تبصرہ حذف نہیں کیا جا سکا۔','Invalid comment author ID.'=>'تبصرہ کرنے والے صارف کی جو آئی ڈی آپ نے منتخب کی ہے وہ موجود نہیں۔','Unique identifier for the object.'=>'اعتراض کے لیے منفرد شناخت۔','The ID of the user object, if author was a user.'=>'صارف کے اوبجیکٹ کی آئی ڈی اگر مصنف ایک صارف تھاا','Email address for the object author.'=>'اوبجیکٹ کے مصنف کے لیے ای میل ایڈریس','IP address for the object author.'=>'مصنف کے اوبجیکٹ کا آئی پی ایڈریس ','Display name for the object author.'=>'اوبجیکٹ مصنف کا نام','URL for the object author.'=>'اوبجیکٹ کے مصنف کے لیے لنک','User agent for the object author.'=>'آبجیکٹ کے مصنف کے لیے صارف کا ایجنٹ۔','The content for the object.'=>'اوبجیکٹ کے لیے مواد۔','Content for the object, as it exists in the database.'=>'اوبجیکٹ کے لیے کانٹیٹ، ڈیٹابیس کے لحاظ سے۔','HTML content for the object, transformed for display.'=>'دکھانے کے لیے تبدیل کیا گیا اوبجیکٹ کا HTML کے لحاظ سے کانٹینٹ','URL to the object.'=>'آبجکٹ کا URL','The ID for the parent of the object.'=>'اوبجیکٹ کے پیرنٹ کے لیے آئی ڈی۔','The ID of the associated post object.'=>'پوسٹ اوبجیکٹ کے ساتھ منسلکہ آئی ڈی۔','State of the object.'=>'ابجیکٹ کی حالت','Type of Comment for the object.'=>'اوبجیکٹ کے لیے تبصرے کی قِسم۔','Avatar URL with image size of %d pixels.'=>'تصویر کا لنک جوکہ  %d پکسلز کی ہے','Avatar URLs for the object author.'=>'اوبجیکٹ کے مصنف کے لیے اواٹار کے لنکس','Limit response to posts published after a given ISO8601 compliant date.'=>'شکایت کی تاریخ ISO8601 کے بعد شائع کی گئی پوسٹوں کے جوابات کو محدود کریں۔','Limit result set to comments assigned to specific user IDs. Requires authorization.'=>'نتائج میں صرف مخصوص صارف کی آئی ڈی سے منسلکہ تبصرے شامل ہوں ۔ اس کے لیئے اجازت درکار ہوگی۔','Ensure result set excludes comments assigned to specific user IDs. Requires authorization.'=>'یقنی بنائیں کہ نتائج میں مخصوص صارف کی آئی ڈی سے منسلکہ تبصرے موجود نہیں۔ اس کے لیئے اجازت درکار ہے۔','Limit result set to that from a specific author email. Requires authorization.'=>'مخصوس مصنف کی ای میل کی جانب سے نتائج کی حد مقرر کی گئی ہے۔ اس کے لیے اجازت درکار ہو گی۔','Limit response to posts published before a given ISO8601 compliant date.'=>'شکایت کی تاریخ ISO8601 سے قبل شائع کی گئی پوسٹوں کے جوابات کو محدود کریں۔','Invalid status.'=>'غلط اسٹیٹس۔','Ensure result set excludes specific IDs.'=>'اِس بات کی یقین دہانی کریں ، کے نتیجہ سیٹ مخصوص آئی ڈیز پر مشتمل نا ہو.','Limit result set to specific IDs.'=>'نتائج کو مخصوص آئی ڈیز تک محدود رکھیں۔','Order sort attribute ascending or descending.'=>'زمروں کو خصوصیات کے لحاظ سے ترتیب دیں۔','Sort collection by object attribute.'=>'چیزوں کو اوبجیکٹ کی خصوصیات کے لحاظ سے تر تیب دیں۔','Limit result set to comments of specific parent IDs.'=>'نتائج کوخاص پیرنٹ آئی ڈیزکے وسائل تک محدودکریں۔','Ensure result set excludes specific parent IDs.'=>'نتائج میں یقینی بنائیں کہ خاص بنیادی آئی ڈیز کو خارج کیا جائے۔','Limit result set to comments assigned to specific post IDs.'=>' نتائج کو وسائل تک محدود رکھیں جوخاص پوسٹ آئی ڈیز کو منسوب کیے گئے ہیں۔ ','Limit result set to comments assigned a specific status. Requires authorization.'=>'ایک مخصوص قسم کے اسٹیٹس کے لیے نتائج کی حد مقرر کی گئی ہے۔ اس کے لیے اجازت درکار ہو گی۔','Limit result set to comments assigned a specific type. Requires authorization.'=>'نتائج کی حد مقرر کی گئی ہے ایک مخصوص قسم کے تبصرے کے لیے۔ اس کے لیے اجازت درکار ہوگی۔','Current page of the collection.'=>'مجموعے کا موجودہ صفحہ۔','Maximum number of items to be returned in result set.'=>'نتائج کے مجموعے میں جتنی زیادہ سے زیادہ اشیاء آ سکتی ہیں۔','Whether posts with this status should be private.'=>'چاہے اس اسٹیٹس کے ساتھ پوسٹ نجی ہونا چاہیے.','Whether posts with this status should be protected.'=>'چاہے اس اسٹیٹس کے ساتھ پوسٹیں محفوظ رکھنا چاہیے۔','Whether posts of this status should be shown in the front end of the site.'=>'چاہے اس اسٹیٹس کی پوسٹیں سائٹ کے فرنٹ اینڈ میں دکھائی جائیں۔','Method \'%s\' not implemented. Must be overridden in subclass.'=>'\'%s\' طریقے پر عمل نہیں ہوا۔ لازمی کسی سب کلاس میں مسترد ہوچکا ہے۔','Whether posts with this status should be publicly-queryable.'=>'موجودہ ذریعہ سے منسلک پوسٹس کا عوامی طور پر قابل تلاش ہونے کے متعلق فیصلہ۔','Whether to include posts in the edit listing for their post type.'=>'پوسٹوں کے لیے فہرست کی تصیح میں پوسٹ کوشامل کرنے کے متعلق فیصلہ۔','Cannot view post type.'=>'پوسٹ کی قسم نہیں دیکھ سکتے۔','Sorry, you are not allowed to manage post statuses.'=>'معاف کیجیے گا، آپ کو پوسٹ اسٹیٹس منظم کرنے کی اجازت نہیں ہے۔','Permalink template for the object.'=>'اوبجیکٹ کے لیے پرمالنک ٹیمپلیٹ','All capabilities used by the taxonomy.'=>'تمام صلاحیتیں جو اصول صنف بندی کے زیر استعمال ہیں۔','A human-readable description of the taxonomy.'=>'ذریعے کی تفصیل جو کہ انسانوں کے پڑھنے کے قابل ہو۔','Whether or not the taxonomy should have children.'=>'اصول صنف بندی کے بچے ہونے کے متعلق فیصلہ۔','Human-readable labels for the taxonomy for various contexts.'=>'مختلف سیاق و سباق والے ذراع کے لیے لیبل جو کہ انسانوں کے پڑھنے کے قابل ہوں۔','The title for the post type.'=>'پوسٹ کی قسم کے لیے عنوان۔','The password for the post if it is password protected.'=>'اس پوسٹ کے لیے پاسورڈ اگر یہ پاسورڈ سے محفوظ کی گئی ہے۔','You need to define a search term to order by relevance.'=>'آپ مطابقت کے لحاظ سے ترتیب دینے کے لیے ایک تلاش کی ایک اصطلاح متعارف کروا سکتے ہیں۔','Incorrect post password.'=>'غلط پوسٹ پاسورڈ','Cannot create existing post.'=>'پہلے سے موجود پوسٹ آپ نہیں بنا سکتے','Sorry, you are not allowed to edit comments.'=>'معاف کیجیے گا، آپ کو تبصروں میں ترمیم کرنے کی اجازت نہیں ہے۔','The post has already been deleted.'=>'پوسٹ پہلے ہی حذف کر دی گئی ہے۔','A post can not be sticky and have a password.'=>'ایک پوسٹ بیک وقت نمایاں اور پاسورڈ سے محفوظ نہیں ہوسکتی۔','A sticky post can not be password protected.'=>'ایک نمایاں کی گئی پوسٹ کو آپ پاسورڈ کے ذریعے