ether the excerpt is protected with a password.'=>'چاہے اقتباس کو پاسورڈ کی مدد سے محفوظ کیا جائے۔','The ID of the featured media for the object.'=>'شے کے خصوصیاتی میڈیا کی آئی ڈی۔','Whether or not comments are open on the object.'=>'اوبجیکٹ پر تبصرات کی اجازت دینے کے متعلق فیصلہ۔','Whether or not the object can be pinged.'=>'اوبجیکٹ کو پِنگ کرنے یا نا کرنے کے متعلق فیصلہ۔','The order of the object in relation to other object of its type.'=>'اوبجیکٹ کی اپنی قسم کے دوسرے اوبجیکٹ کے ساتھ تعلق کے مطابق۔','The format for the object.'=>'اوبجیکٹ کے لیے ترتیب۔','Whether or not the object should be treated as sticky.'=>'اوبجیکٹ کے ساتھ چسپاں والا سلوک کرنے کے متعلق فیصلہ۔','A password to protect access to the content and excerpt.'=>'ایک پاسورڈ مندرجات اور اقتباس تک رسائی کی حفاظت کے لیے۔','The theme file to use to display the object.'=>'قابل استعمال تھیم کی فائل اوبجیکٹ کو ظاہر کرنے کے لیے۔','The terms assigned to the object in the %s taxonomy.'=>'اصطلاحات جو کہ %s ٹکسانومی میں موجود اوبجیکٹ کو تفویض شدہ ہیں۔','Limit result set to posts assigned to specific authors.'=>' نتائج کو خاص مصنفوں کو مخصوص کی گئی پوسٹوں تک محدود کریں۔','Ensure result set excludes posts assigned to specific authors.'=>'نتائج میں یقینی بنائیں کہ خاص مصنفوں کو مخصوص کی گئی پوسٹوں کو خارج کیا جائے۔ ','Limit result set to posts with a specific menu_order value.'=>'مخصوص مینو_ آرڈر کی ویلیو کے ساتھ پوسٹوں کو محدود کرنے کا نتیجہ۔','Offset the result set by a specific number of items.'=>'اشیاء کی ایک مخصوص تعداد کی طرف سے مقرر اوفسیٹ نتیجہ۔','Limit result set to items with particular parent IDs.'=>'نتائج کو مخصوص پیرنٹ آئی ڈی والی اشیا ء تک محدود کریں۔','Limit result set to all items except those of a particular parent ID.'=>'نتائج کو مخصوص پیرنٹ آئی ڈی کے علاوہ تمام اوبجیکٹس کے لیے محدود کریں۔','Limit result set to all items that have the specified term assigned in the %s taxonomy.'=>'حدود کے نتائج ان تمام اشیاٗ سے منسلک ہیں جن کے ساتھ %s ٹیکسانومی میں مخصوص ٹرم منسلک ہے۔','Limit result set to items that 