ription of the post type.'=>'پوسٹ کی قسم کی انسانی قابل مطالعہ تفصیل۔','Whether or not the post type should have children.'=>'چاہے ہو یا نہ ہو پوسٹ کی قسم کے ساتھ چلڈرن ہونا ضروری ہے۔','Human-readable labels for the post type for various contexts.'=>'مختلف سیاق و سباق کی پوسٹ کی قسم کے لیے انسانی قابل مطالعہ لیبل ٹائپ کریں۔','An alphanumeric identifier for the post type.'=>'پوسٹ کی قسم کے لیے ایک حرفی ہندسہ شناخت کنندہ۔','REST base route for the post type.'=>'پوسٹ کی قسم کے لیے REST بیس روٹ','Required to be true, as revisions do not support trashing.'=>'ٹھیک ہونا ضروری ہے، جیسا کہ نظرثانیاں حذف کرنے کو سپورٹ نہیں کرتے۔','An alphanumeric identifier for the taxonomy.'=>'ٹیکسانومی کے لیے ایک حرفی ہندسہ شناخت کنندہ۔','The password for the parent post of the comment (if the post is password protected).'=>'تبصرے کی بنیادی پوسٹ کا پاسورڈ (اگر پوسٹ کو پاسورڈ کے ذریعے سے محفوظ کیا گیا ہے)۔','All features, supported by the post type.'=>'تمام خصوصیات، جو پوسٹ کی قسم کو سپورٹ کرتی ہے۔','You need to define an include parameter to order by include.'=>'آپ کو شامل کرنے کے لحاظ سے ترتیب دینے کے لیے شامل کرنے کے پیرامیٹر کی ضرورت ہے۔','The page number requested is larger than the number of pages available.'=>'درخواست کردہ صفحے کا نمبر کُل موجود صفحات کے نمبر سے زیادہ ہے۔','pluginUpdated!'=>'اپڈیٹ ہوگئی ہے!','themeUpdated!'=>'اپڈیٹ ہو گئی پے۔','pluginUpdate %s now'=>'%s  کو ابھی اپڈیٹ کریں','pluginUpdating %s...'=>'%s اپڈیٹ ہو رہی ہے۔۔۔','plugin%s updated!'=>'%s اپڈیٹ ہوگئی!','plugin%s update failed'=>'%s کی اپڈیٹ میں ناکامی','pluginInstall %s now'=>' %s ابھی انسٹال کریں۔','pluginInstalled!'=>'انسٹال ہو گیا ہے!','themeInstalled!'=>'انسٹال ہو گئی ہے!','pluginDeleted!'=>'(پلگ ان) حذف کر دیا گیا۔','themeDeleted!'=>'(تھیم) حذف کر دی گئی۔','Displays an audio player.'=>'ایک آڈیو پلیئر دکھاتا ہے۔','No audio selected'=>'کوئی آڈیو منتخب نہیں ہے۔','label for button in the audio widget; should preferably not be longer than ~13 characters longReplace Audio'=>'آڈیو تبدیل کریں','label f